"use strict";(self.webpackChunkcast_coop_work_term_report=self.webpackChunkcast_coop_work_term_report||[]).push([[678],{1372:function(e,t,o){o.r(t),o.d(t,{default:function(){return b}});var n=o(7294),a=o.p+"static/cast-logo-82419bb8ab89996b84a6de35d8bb8d5e.jpg",i=o.p+"static/jest-icon-37efbf74e1e0f8eb6ddb468b98d6f6e4.png",r=o.p+"static/react-icon-2c3be408b49f1b1be4bbfbbef73c3959.png",s=o.p+"static/communication-icon-ca03e9f848921327699614c486bdad56.png",l=o.p+"static/postgres-icon-19f1ad4d8edf7fd0c63f3e485f5f4c00.png",c=o.p+"static/clean-code-icon-100b6bde0ff520c3df802f3b9338d062.png",d={margin:"auto",width:"50%"},m={backgroundColor:"#eee",color:"#232129",paddingBottom:50,paddingTop:50,fontFamily:"-apple-system, Roboto, sans-serif, serif"},h={fontSize:"56px",marginTop:0,marginBottom:64,textAlign:"center"},u={fontSize:"36px"},g={textAlign:"center"},p={width:"50%"},w={paddingRight:"15px"},f={maxHeight:"100px",maxWidth:"100px"},y={display:"flex"},b=function(){return n.createElement("main",{style:m},n.createElement("div",{style:d},n.createElement("title",null,"Cast Co-op 2021 Work Term Report"),n.createElement("h1",{style:h},"Cast Co-op 2021 Work Term Report"),n.createElement("div",{style:g},n.createElement("img",{src:a,style:p,alt:"Cast Logo"})),n.createElement("h2",{style:u},"Introduction"),n.createElement("p",null,"Hi, I'm Greg. I'm a Bachelor of Computing co-op student at the University of Guelph currently studying computer science. Over the past Summer and Fall of 2021, I've been working as a co-op student at a social media startup called Cast. The following contains a brief overview of my experience."),n.createElement("h2",{style:u},"About Cast"),n.createElement("p",null,"Cast was a social media company founded in 2020 located in the heart of downtown Toronto. It was primarily a mobile application that ran on both Android and iOS. The app's main core concept was built around social voting that allowed people to share their opinions on various topics and have people vote on those topics anonymously. These topics could range anywhere from social issues to politics to sports and even dating. Whatever was on someone's mind, they could ask it and people around the world could vote on it. Since Cast was founded during the Covid-19 pandemic, the company was remote-first by default but had an office downtown Toronto where employees could meet, hang out, and discuss strategy. I ended up visiting the office twice. Once to meet with the engineering team to discuss preliminary plans for the development of Cast V2, a newer and sleeker version of the app, and another to meet with the entire team right before the official launch of V2 at the end of the summer. The company also held two early morning daily standups over Google Meet, one for the engineering team, and one for the marketing team. On top of that, there were also weekly one-on-one meetings with each member of the team, meaning that each person would meet with every other person on the team virtually at least one time per week. This allowed each team member to discuss in-depth details of what they were working on to keep everyone in the loop. Unfortunately, the company folded in November of 2021 due to budgetary reasons and concerns that the app was not growing as fast enough as the founders had hoped."),n.createElement("h2",{style:u},"Job Description"),n.createElement("p",null,"I was originally hired on with the company to do software QA. This would entail both manually testing the app as well as writing automated unit tests. The job quickly transitioned into more of a software engineering role as I took on more and more software-related tasks on top of the testing work I was doing at the time. This entailed working on the frontend mobile application using React Native, working on the backend using Node.js in conjunction with both a Postgresql database as well as Google Firestore. Some of the projects I worked on at Cast include, but are not limited to, revamping user profiles for Cast V2, building out the re-cast feature for users to re-cast other peoples casts, building the expiring cast feature that enabled users to set a time on their casts when people are no longer allowed to vote, and building out admin dashboard tools for better reporting and analysis to improve user experience."),n.createElement("h2",{style:u},"Goals"),n.createElement("p",null,"During my time at Cast, I developed 6 learning goals. Goals that I could strive for to help make me a better developer, and a better professional in the software industry. Here is a brief overview of those goals along with my progress in achieving them."),n.createElement("div",{style:y},n.createElement("div",{style:w},n.createElement("p",null,n.createElement("img",{src:i,style:f,alt:"Jest Icon"}))),n.createElement("div",null,n.createElement("p",null,n.createElement("strong",null,"Write automated unit tests that cover the entire Cast mobile application -")," the purpose of this goal was to improve my ability to write automated unit tests and gain more experience using frontend unit testing tools such as Jest and React Testing Library. While I wasn’t able to test the entire system due to my role switching more to a software engineering role, I was able to write automated tests for large parts of the application which helped to keep those components of the application consistent and bug-free."))),n.createElement("div",{style:y},n.createElement("div",{style:w},n.createElement("p",null,n.createElement("img",{src:r,style:f,alt:"React Icon"}))),n.createElement("div",null,n.createElement("p",null,n.createElement("strong",null,"Achieve expertise in React -")," React is an incredibly valuable skill to know and since one of the core technologies used at Cast was React Native, I thought it would be worth my time to spend time digging deep into the core features of React to learn as much as possible about the technology. This would not only make me a valuable contributor to the engineering team at Cast but also any future company that I work with that uses React. Overall, I ended up seeing my React skills grow tremendously and was able to obtain a solid grasp of the core concepts. I now feel a lot more comfortable building out apps and features with it."))),n.createElement("div",{style:y},n.createElement("div",{style:w},n.createElement("p",null,n.createElement("img",{src:s,style:f,alt:"Communication Icon"}))),n.createElement("div",null,n.createElement("p",null,n.createElement("strong",null,"Improve my communication skills -")," The purpose of this goal was to improve the way I communicate technical information to other people. When communicating technical concepts it’s very important to explain them in a way that the other person can understand based on their background and level of understanding. If the other person comes from a non-technical background, it’s important not to use too much unnecessary technical jargon that just ends up confusing them. It’s better to break something down into simpler terms that they can understand. This is certainly a skill that needs to be developed and one that I have felt develop throughout my time at Cast, both through the daily standups every morning, and my one-on-one meetings with coworkers."))),n.createElement("div",{style:y},n.createElement("div",{style:w},n.createElement("p",null,n.createElement("img",{src:l,style:f,alt:"Postgres Icon"}))),n.createElement("div",null,n.createElement("p",null,n.createElement("strong",null,"Improve my SQL query skills -")," This goal was intended to improve my ability to write SQL queries, both in terms of my ability to write high-quality queries in one-shot, but also make them very performant in how they execute when interacting with the database. For example, I went from having limited knowledge of how “join” queries work, to being able to write pretty advanced join queries by the end of my term. This allowed me to take queries that were being split up into chunks, combine them into a single query using joins, thus reducing the latency of the HTTP requests utilizing those requests, sometimes by an order of magnitude. I also learned a lot about how databases work under the hood to get a better understanding of what is going on when SQL queries are executed on a system."))),n.createElement("div",{style:y},n.createElement("div",{style:w},n.createElement("p",null,n.createElement("img",{src:"data:image/png;base64,",style:f,alt:"Data Structures and Algorithms Icon"}))),n.createElement("div",null,n.createElement("p",null,n.createElement("strong",null,"Continue to hone my data structures and algorithms skills -")," This was one of my favourites. One of my favourite aspects of programming is getting to work with algorithms and data structures. Throughout my term, I was able to work with many algorithms and data structures including but not limited to binary search, depth-first search, heaps, and hash tables. Being able to take theoretical concepts that I’ve learned in school and independently, and be able to apply those concepts to a real-world system to increase efficiency and make the overall system a lot faster was a great feeling and one that excites me going into the future."))),n.createElement("div",{style:y},n.createElement("div",{style:w},n.createElement("p",null,n.createElement("img",{src:c,style:f,alt:"Clean COde Icon"}))),n.createElement("div",null,n.createElement("p",null,n.createElement("strong",null,"Improve my ability to write clean code -")," This goal was important as well. Being able to write clean, well-written code that is easy to understand is very important to me. This is also something that will be more and more important as I progress throughout my career. This includes being able to write code for other people and not just yourself so that other people can take your code, build upon it and refactor it. This is an invaluable skill to have and a skill I was able to improve upon during my term. Some examples include writing expressive variable names, writing concise functions that emphasized code-reuse throughout the application and using just the right amount of abstraction when writing components so that these same components could be used elsewhere in the application when the time arose. I look forward to continuing to improve this ability in the future."))),n.createElement("h2",{style:u},"Conclusions"),n.createElement("p",null,"Working at a Cast was a wonderful opportunity to work with great people and great technology. Throughout my co-op term, I’ve been able to grow tremendously, both as a person and as a software developer. This is one co-op term that I will remember for a long time."),n.createElement("h2",{style:u},"Acknowledgments"),n.createElement("p",null,"I would like to thank George Boutsalis, David Banwat, and Graydyn Young for originally hiring me on to the team and giving me the opportunity to work at Cast. I would also like to thank Chance Squires for helping to make me a better front-end developer, especially when it comes to React and React Native.")))}}}]);
